a411a714-04a7-4404-a44f-af09367aa40f	190b8db3-fe73-42c8-815c-793a7b9fc2a7	0	お好み焼き	Okonomiyaki	Other	Okonomiyaki is a savory Japanese pancake made by mixing batter with cabbage, green onions, and your choice of ingredients like pork, seafood, or cheese. It’s cooked on a hot griddle, then topped with a tangy sauce, mayonnaise, dried seaweed flakes, and bonito flakes. Popular in Osaka and Hiroshima, okonomiyaki means "grill as you like," allowing endless delicious variations that reflect local tastes and creativity.	completed	completed	completed	2025-06-30 00:22:40.453005	2025-06-30 00:22:40.468932
1d61adfe-d58f-41d3-b2b8-d698b91d960c	190b8db3-fe73-42c8-815c-793a7b9fc2a7	1	たこ焼き	Takoyaki	Other	Takoyaki are savory Japanese snack balls made from a batter cooked in a special molded pan, filled with tender pieces of octopus, green onions, and pickled ginger. Crispy on the outside and soft inside, they’re topped with a tangy sauce, mayo, bonito flakes, and seaweed. Originating from Osaka, takoyaki is a popular street food that offers a fun, delicious taste of Japanese casual dining culture.	completed	completed	completed	2025-06-30 00:22:40.47787	2025-06-30 00:22:40.486591
0d133d83-1892-4912-aaf7-cd81a011f600	a501cd5d-1bc7-4fb3-8e38-73bbd94ab127	1	アイスコーヒー	Iced Coffee	ドリンク	Iced Coffee (アイスコーヒー) is a refreshing, chilled drink made by brewing strong coffee and then cooling it down with ice. This popular Japanese beverage offers a smooth, rich flavor with subtle bitterness and a hint of natural sweetness. Perfect for hot days, it’s enjoyed across Japan and often served in cafes, providing a modern twist on traditional coffee culture.	completed	completed	completed	2025-06-30 00:22:40.570172	2025-06-30 00:22:40.575685
adf16397-a0e9-4c6a-9cf7-b5c0787963d3	009b8130-52d1-4c3f-8e74-45145e01818e	2	カレーライス	Curry Rice	Other	Curry Rice (カレーライス) is a popular Japanese comfort food featuring tender chunks of meat and vegetables simmered in a rich, mildly spicy curry sauce. Served over steamed white rice, it blends a unique mix of Japanese and Indian spices for a warm, savory flavor. This hearty dish is loved nationwide and often enjoyed at home or in casual restaurants, making it a must-try for visitors seeking authentic everyday Japanese cuisine.	completed	completed	completed	2025-06-30 00:22:40.498188	2025-06-30 00:22:40.50412
bda2f308-bf0b-4659-93f0-e735c7514b14	009b8130-52d1-4c3f-8e74-45145e01818e	1	そば	buckwheat	Other	Soba is a traditional Japanese dish made from thin noodles crafted from buckwheat flour, served hot in broth or cold with a dipping sauce. The noodles have a nutty, earthy flavor and a firm, chewy texture. Soba is popular year-round and often enjoyed during special occasions like New Year's Eve to symbolize longevity and good fortune. It's a healthy, comforting choice that showcases simple but refined Japanese flavors.	completed	completed	completed	2025-06-30 00:22:40.507517	2025-06-30 00:22:40.516617
2e3a1581-604f-4baf-85e0-9313fa785ff3	a501cd5d-1bc7-4fb3-8e38-73bbd94ab127	11	ジェラート2種	2 types of gelato	デザート	Enjoy two flavors of authentic Japanese gelato, crafted from fresh, natural ingredients like seasonal fruits, matcha green tea, or rich black sesame. This creamy frozen dessert is churned slowly for a smooth texture and delicate taste. Gelato offers a lighter, less sweet alternative to ice cream, perfect for cooling down during warm days while experiencing a unique Japanese twist on a classic treat.	completed	completed	completed	2025-06-30 00:22:40.604097	2025-06-30 00:22:40.608873
ca46b016-c886-43c1-bd65-0607ae6a3255	7dbdd5cb-b0ef-4ca8-9628-f6911c853c19	0	寿司	Sushi	Main Dishes	Fresh sushi with premium fish	completed	completed	completed	2025-06-30 00:22:40.528068	2025-06-30 00:22:40.533715
2e8e83f5-7977-45da-bdaa-4b3ea6c2008d	a501cd5d-1bc7-4fb3-8e38-73bbd94ab127	8	アップル	Apple	ドリンク	アップル is a refreshing Japanese apple-flavored drink made from fresh apple juice blended with sparkling water or soda, offering a sweet and slightly tart taste. It's served chilled, perfect for warm days or as a light, fruity refreshment. Popular in Japan, this drink reflects the country's love for seasonal fruits and simple, natural flavors that balance sweetness and acidity.	completed	completed	completed	2025-06-30 00:22:40.579097	2025-06-30 00:22:40.584535
07541291-905e-4704-82d9-eac561cde200	7dbdd5cb-b0ef-4ca8-9628-f6911c853c19	1	天ぷら	Tempura	Appetizers	Light and crispy tempura	completed	completed	completed	2025-06-30 00:22:40.536928	2025-06-30 00:22:40.542167
