ecbb4899-1eaa-4481-a04f-29909a3ac340	a501cd5d-1bc7-4fb3-8e38-73bbd94ab127	10	本日のケーキ	Today's Cake	デザート	Today's Cake is a delightful seasonal dessert, carefully baked fresh daily using high-quality local ingredients like eggs, flour, and sugar. Its soft, moist texture pairs perfectly with a subtly sweet flavor, often featuring hints of fruit or matcha. Enjoy this popular treat with your tea while experiencing Japan’s rich tradition of turning simple sweets into memorable moments.	completed	completed	completed	2025-06-30 00:22:40.595986	2025-06-30 00:22:40.600787
3575dda5-e12f-4de4-93fb-e59c8e6ce06c	a501cd5d-1bc7-4fb3-8e38-73bbd94ab127	0	ブレンド	blend	ドリンク	ブレンド is a carefully crafted coffee blend made by mixing different high-quality beans, roasted to bring out a balanced and rich flavor. This popular drink in Japan offers a smooth, mild taste with subtle hints of sweetness and bitterness. Enjoyed daily by many, it reflects the Japanese appreciation for harmony and simplicity in their coffee culture. Perfect for a relaxing break during your travels!.	completed	completed	completed	2025-06-30 00:22:40.560594	2025-06-30 00:22:40.566521
86993458-3669-464f-8cec-083b276334df	a501cd5d-1bc7-4fb3-8e38-73bbd94ab127	9	にんじん	Carrot	ドリンク	にんじん is a refreshing Japanese carrot juice made by blending fresh, sweet carrots into a smooth drink. Naturally sweet with earthy undertones, it’s a nutritious and energizing beverage often enjoyed for its vibrant color and health benefits. Perfect for a light refreshment, it reflects Japan’s appreciation for simple, wholesome ingredients in everyday life.	completed	completed	completed	2025-06-30 00:22:40.587782	2025-06-30 00:22:40.592837
a349c7a1-aebb-4dcd-9791-3889a19cad6a	a501cd5d-1bc7-4fb3-8e38-73bbd94ab127	12	プリン	Pudding	デザート	Purin is a smooth and creamy Japanese custard pudding made from eggs, milk, and sugar, gently baked in a water bath to achieve its silky texture. Topped with a rich caramel sauce, it offers a perfect balance of sweet and slightly bitter flavors. Popular in Japan since the early 20th century, purin is a beloved dessert enjoyed by all ages and a delightful treat for visitors seeking a taste of Japanese comfort sweets.	completed	completed	completed	2025-06-30 00:22:40.61226	2025-06-30 00:22:40.617038
e16f6684-3952-4ada-a415-3972218e16c5	a501cd5d-1bc7-4fb3-8e38-73bbd94ab127	6	ハーブティー	Herbal tea	ドリンク	Herbal tea (ハーブティー) in Japan is a soothing infusion made by steeping a variety of dried herbs such as chamomile, peppermint, or yuzu peel in hot water. Known for its refreshing and calming flavors, it is often enjoyed during quiet moments or after meals. This caffeine-free drink reflects Japan’s appreciation for natural wellness and seasonal ingredients, offering a gentle, aromatic experience perfect for relaxation.	completed	completed	completed	2025-06-30 00:22:40.620679	2025-06-30 00:22:40.625218
e9271cf4-cd9f-49f1-af39-0036b31a66a3	a501cd5d-1bc7-4fb3-8e38-73bbd94ab127	3	カプチーノ	cappuccino	ドリンク	Cappuccino is a popular Italian-style coffee drink loved in Japan, made by combining rich espresso with steamed milk and topped with smooth, velvety milk foam. Its balanced flavor offers a perfect mix of bold coffee and creamy sweetness. Enjoyed in cozy cafes across Japan, cappuccino provides a warm and comforting break, reflecting the country’s wonderful embrace of global coffee culture.	completed	completed	completed	2025-06-30 00:22:40.628054	2025-06-30 00:22:40.632879
cee2ad41-84af-4939-8ada-9f335a82ca44	a501cd5d-1bc7-4fb3-8e38-73bbd94ab127	4	アールグレイ	Earl Grey	ドリンク	Earl Grey is a fragrant black tea flavored with natural bergamot oil, giving it a refreshing citrus aroma and smooth, slightly floral taste. Enjoyed hot or iced, this classic drink is popular in Japan as a calming refreshment. Perfect for relaxing moments, Earl Grey blends Western tea tradition with Japanese appreciation for delicate flavors and seasonal enjoyment.	completed	completed	completed	2025-06-30 00:22:40.636332	2025-06-30 00:22:40.640937
42c3c594-384f-4e49-b6c7-8a9e6f0dcd99	a501cd5d-1bc7-4fb3-8e38-73bbd94ab127	7	オレンジ	orange	ドリンク	オレンジ is a refreshing Japanese drink made from freshly squeezed oranges, often served chilled or over ice. This natural beverage highlights the sweet and tangy flavors of ripe oranges, making it a perfect thirst-quencher during warm weather. Popular in cafes and vending machines across Japan, it offers a simple yet delicious taste of Japanese citrus culture, loved by locals and visitors alike.	completed	completed	completed	2025-06-30 00:22:40.643899	2025-06-30 00:22:40.64873
